import React from "react";
import { Container } from "react-bootstrap";
import Header from "./components/Header";
import Footer from "./components/Footer";

const App = () => {
  return (
    <div className="App">
      <React.Fragment>
        <Header />
        <main className='py-3'>
          <Container>
            <h1>Welcome To Cash & Delivery</h1>
          </Container>
        </main>
        <Footer />
      </React.Fragment>
    </div>
  );
};

export default App;
